import React, {Component} from 'react';
import './App.css';
import Grid from './grid';
class App extends Component{
  render(){
    return (
      <div className="container">
      <div className="App">
            <div className="page-header text-center">
              <h1>GAME OF LIFE</h1>  
            </div>
        <div>
        <Grid rows={10} cols={10}/>
        </div>
      </div>
      </div>
    );
  };
}

export default App;
